import logo from './logo.svg';
import './App.css';
import Header from './Header';
import Footer from './Footer';
import Contact from './Contact';
import {BrowserRouter, Routes, Switch} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
      <Header/>
      <p>Players</p>
      <Contact/>
      <Footer/>
    </div>
    </Router>

  );
}

export default App;
